# coding=utf-8import reclass RegexUtils(object):    re_url = "(https?|ftp|file)://[-A-Za-z0-9+&@#/%?=~_|!:,.;]+[-A-Za-z0-9+&@#/%=~_|]"    re_ip = "(2(5[0-5]{1}|[0-4]\\d{1})|[0-1]?\\d{1,2})(\\.(2(5[0-5]{1}|[0-4]\\d{1})|[0-1]?\\d{1,2})){3}"    re_time = "[1-9]\\d{3}-(0[1-9]|1[0-2])-(0[1-9]|[1-2][0-9]|3[0-1])\\s+(20|21|22|23|[0-1]\\d):[0-5]\\d:[0-5]\\d"    def find_url(self, src):        return re.findall(self.re_url, src)    def find_ip(self, src):        return re.findall(self.re_ip, src)    def find_time(self, src):        return re.findall(self.re_time, src)